import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';



class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: null,
      s : "out"
    };
  }

  componentDidMount() {
    console.log("----");
    fetch("/")

    .then(res => res.json())
    .then(
      (result) => {
        this.setState({
          isLoaded: true,
          items: result,
          s : "in"



        });

      },

      (error) => {
        this.setState({
          isLoaded: "error",
          s : "error"

        });
      }
    )
    console.log(this.state.s);
    console.log(this.state.items);
  }


  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
